import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 3.2-5145 Punishment for failure to comply with requirements of certain chapters.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5145.md","filePath":"vacode/3.2-5145.md"}'),o={name:"vacode/3.2-5145.md"},i=a('<h1 id="§-3-2-5145-punishment-for-failure-to-comply-with-requirements-of-certain-chapters" tabindex="-1">§ 3.2-5145 Punishment for failure to comply with requirements of certain chapters. <a class="header-anchor" href="#§-3-2-5145-punishment-for-failure-to-comply-with-requirements-of-certain-chapters" aria-label="Permalink to &quot;§ 3.2-5145 Punishment for failure to comply with requirements of certain chapters.&quot;">​</a></h1><p>Any person who refuses to comply upon demand with the requirements of this chapter and Chapters 52 (§ <a href="http://law.lis.virginia.gov/vacode/3.2-5200/" target="_blank" rel="noreferrer">3.2-5200</a> et seq.) and 54 (§ <a href="http://law.lis.virginia.gov/vacode/3.2-5400/" target="_blank" rel="noreferrer">3.2-5400</a> et seq.) who shall impede, obstruct, hinder, or otherwise prevent or attempt to prevent any inspector or other person in the performance of his duty in connection with such chapters, is guilty of a Class 2 misdemeanor, unless otherwise specified, and such fines, less the legal costs, shall be paid into the state treasury.</p><p>Code 1950, § 3-339; 1966, c. 702, § 3.1-418; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0185" target="_blank" rel="noreferrer">185</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),n=[i];function s(c,h,l,p,f,u){return t(),r("div",null,n)}const _=e(o,[["render",s]]);export{m as __pageData,_ as default};
